/* eslint no-unused-vars: 0 */
import ifDefined from '@ui5/webcomponents-base/dist/renderer/ifDefined.js';
import { html, svg, repeat, classMap, styleMap } from '@ui5/webcomponents-base/dist/renderer/LitRenderer.js';
const block0 = (context) => { return html`<div id="${ifDefined(context._id)}" class="ui5-timepicker-root" @keydown="${context._ontimepickerkeydown}"><ui5-input			id="${ifDefined(context._id)}-inner"			value="${ifDefined(context.value)}"			placeholder="${ifDefined(context._placeholder)}"			?disabled="${context.disabled}"			?readonly="${context.readonly}"			value-state="${ifDefined(context.valueState)}"			@click="${context._handleInputClick}"			@ui5-change="${ifDefined(context._handleInputChange)}"			@ui5-input="${ifDefined(context._handleInputLiveChange)}"	>	${ !context.readonly ? block1(context) : undefined }</ui5-input></div>`; };
const block1 = (context) => { return html`<ui5-icon			slot="icon"			name="time-entry-request"			tabindex="-1"			show-tooltip			@click="${context.togglePicker}"			input-icon			?pressed="${context._isPickerOpen}"			class="ui5-timepicker-input-icon-button"		></ui5-icon>	`; };

export default block0;
